bioghist.p:
Het Centraal Orgaan Tarieven Gezondheidszorg (COTG), 1982-2000

Het COTG werd vanaf 1982 belast met de uitvoering van de Wet tarieven gezondheidszorg (WTG). Het was een publiekrechtelijke zelfstandig bestuursorgaan en viel onder de verantwoordelijkheid van het Ministerie van VWS. 

Het COTG werd op 18 augustus 1981 geïnstalleerd door de Staatssecretaris van Volksgezondheid en Milieuhygiëne. De WTG is in werking getreden op 7 februari 1982. 

De taak was het vaststellen van de tarieven in de gezondheidszorg. Wijzigingen in de WTG hadden tot gevolg dat het COTG vanaf 1 januari 1998 geen richtlijnen meer vaststelde, maar beleidsregels.



De verschillende organen voor gezondheidszorg ressorteerden onder de volgende kamers van het COTG:

-Kamer I: ziekenhuizen en aanverwante organen voor gezondheidszorg;

De Werkgroep Academische Ziekenhuizen (WAZ) viel onder Kamer I.

-Kamer II: verpleeghuizen, Het Dorp, zwakzinnigeninrichtingen, inrichtingen voor zintuiglijk gehandicapten, dagverblijven en gezinsvervangende tehuizen voor gehandicapten. Vanaf 1 januari 1997 behoorden de bejaardenoorden bij Kamer II. Op 1 januari 1998 gingen de dagverblijven en gezinsvervangende tehuizen van Kamer II naar Kamer III;

-Kamer III: psychiatrische ziekenhuizen, inrichtingen voor psychiatrische dag- en/of nachtbehandeling, medische kindertehuizen, medische kleuterdagverblijven en de instellingen voor ambulante geestelijke gezondheidszorg, vanaf 1 januari 1998 ook dagverblijven en gezinsvervangende tehuizen;

-Kamer IV: kruiswerk, kraamwerk, (centrale posten) ambulancevervoer, schooltandartsendiensten, vervaardigers van kunst- en hulpmiddelen, entadministraties en thuiszorg (toegevoegd in 1997);

-Kamer V: zelfstandige medische beroepsbeoefenaren;

-Kamer VI: zelfstandige paramedici, en de verloskundigen.

Het College tarieven gezondheidszorg (CTG) / Zorgautoriteit in oprichting en rechtsvoorgangers (Zaio), 2000-2006

Het COTG werd vanaf 2000 het College tarieven gezondheidszorg en werd later, in de aanloop naar de NZa het College tarieven gezondheidszorg / Zorgautoriteit in oprichting (CTG/Zaio) genoemd. Ook het CTG had Kamers per categorie van organen voor gezondheidszorg. De tarieven kwamen bij voorkeur tot stand in onderhandelingen tussen ziektekostenverzekeraars en organen voor gezondheidszorg. Een overeenkomst werd pas rechtsgeldig als deze door het CTG was goedgekeurd. Indien binnen het overleg tussen de verzekeraars en de organen voor gezondheidszorg geen overeenstemming werd bereikt, of indien het CTG het tarief niet kon goedkeuren, kon het CTG een tarief vaststellen. Het CTG stelde beleidsregels vast inzake de hoogte, opbouw en wijze van berekening van de tarieven. Ook het CTG was het uitvoeringsorgaan van de Wet tarieven gezondheidszorg.



De CTG kende vijf kamers:

-Kamer I: ziekenhuizen, ambulancezorg, revalidatie-instellingen: hartrevalidatie, zelfstandige behandelcentra, Werkgroep Academische Ziekenhuizen;

-Kamer II: verpleeghuizen, verzorgingshuizen, thuiszorg, entadministraties, kraamzorg;

-Kamer III: geestelijke gezondheidszorg, gehandicaptenzorg;

-Kamer IV: verloskundigen, fysiotherapeuten, oefentherapeuten Cesar en Mensendieck, logopedisten;

-Kamer V: huisartsenhulp door huisartsen en apotheekhoudende huisartsen, farmaceutische hulp geleverd door apotheekhoudende huisartsen, apothekers, tandartsen algemeen practici, tandartsspecialisten, medisch specialisten.



In 2005 maakten de kamers plaats voor de Directie Zorgmarkten CARE en de Directie Zorgmarkten CURE.

De Directie Zorgmarkten Care had taken op het gebied van gehandicaptenzorg en verpleging en verzorging. De directie Zorgmarkten Cure hield zich bezig met eerstelijns zorg en ketens, tweedelijns somatische zorg en geestelijke gezondheidszorg.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
